import React from 'react';
import Result from './Result';

function Results({ results, openPopup}) {

    return (

        <section className="results">
            {results.map(result => (
                <Result key={result.mal_id} result={result} openPopup={openPopup} />
            ))}

        </section>
    )
}

export default Results
